window.bookSummaryJSON = "<p><b>I won my brother's rival in a Date the Player auction… and had the best night of my life.</b></p> <p>Davis Guidry is Orleans University's starting rookie pitcher. He's handsome, charming, and an all-around flirt. After spending a hot, spontaneous night together, we can't seem to keep our hands off each other.</p> <p>Our no-strings fun comes crashing down when my overbearing brother, who happens to be Davis's biggest rival, catches us in action. Even that seems to only make the fire burn hotter when we're together.</p> <p>And suddenly, our secret fling starts to feel like something more than either of us bid on.</p> <p>Are these casual hookups between us just a fun way to pass my freshman year… Or have we made the ultimate rookie mistake and caught feelings?</p> <p>Rookie Mistake <i>is a high-spice, low-plot novella in the Orleans University world. It is a complete standalone and lots of fun! Tropes include: college baseball, Playboy Rookie meets Wild Child, \"Good Boy,\" rival's sister, and secret hookups.</i></p>"; 
